{
  "name": "windows-build-tools",
  "version": "5.3.0",
  "description": "Install C++ Build Tools for Windows using npm",
  "main": "dist/index.js",
  "scripts": {
    "test": "npm run lint && npm run unit",
    "unit": "jest",
    "postinstall": "node ./dist/index.js",
    "build": "tsc -p tsconfig.json",
    "prepare": "npm run build",
    "start": "npm run build && npm run postinstall",
    "lint": "tslint -c tslint.json -p tsconfig.json \"src/**/*.ts\""
  },
  "repository": {
    "type": "git",
    "url": "git+https://github.com/felixrieseberg/windows-build-tools.git"
  },
  "os": [
    "win32"
  ],
  "keywords": [
    "Windows",
    "Build Tools",
    "node-gyp",
    "native",
    "c++"
  ],
  "engines": {
    "node": ">=8.0.0"
  },
  "author": "Felix Rieseberg <felix@felixrieseberg.com>",
  "license": "MIT",
  "bugs": {
    "url": "https://github.com/felixrieseberg/windows-build-tools/issues"
  },
  "homepage": "https://github.com/felixrieseberg/windows-build-tools#readme",
  "devDependencies": {
    "@types/chalk": "^2.2.0",
    "@types/fs-extra": "^8.1.1",
    "@types/jest": "^24.0.13",
    "@types/node": "^12.0.8",
    "jest": "^24.8.0",
    "ts-jest": "^24.0.2",
    "tslint": "^6.1.3",
    "tslint-microsoft-contrib": "^6.2.0",
    "typescript": "^4.3.4"
  },
  "dependencies": {
    "chalk": "^2.4.2",
    "debug": "^4.3.1",
    "fs-extra": "^8.1.0",
    "in-gfw": "^1.2.0",
    "nugget": "^2.0.1",
    "string-width": "^4.2.2"
  },
  "jest": {
    "moduleFileExtensions": [
      "ts",
      "tsx",
      "js"
    ],
    "transform": {
      "^.+\\.(ts|tsx)$": "ts-jest"
    },
    "globals": {
      "ts-jest": {
        "tsConfigFile": "tsconfig.json"
      }
    },
    "testMatch": [
      "**/__tests__/**/*-test.+(ts|tsx|js)"
    ]
  }
}

module.exports = (wallaby) => ({
  files: [
    'src/**/*.js?(x)',
    'src/**/*.ts?(x)',
    'src/**/*.html',
    { pattern: '__tests__/**/*-test.ts?(x)', ignore: true },
    { pattern: '__tests__/**/!(*-test)', instrument: false, load: true },
    { pattern: 'package.json', instrument: false, load: true }
  ],

  tests: [
    '__tests__/**/*-test.ts?(x)'
  ],

  env: {
    type: 'node',
    runner: 'node',
    params: { env: 'wallaby=true' }
  },

  testFramework: 'jest',

  // Enable mock hoisting as same as ts-jest does
  // (https://github.com/kulshekhar/ts-jest#supports-automatic-of-jestmock-calls)
  preprocessors: {
    '**/*.js?(x)': (file) => require('babel-core').transform(
      file.content,
      { sourceMaps: true, filename: file.path, presets: ['babel-preset-jest'] })
  },

  workers: {
    initial: 2,
    regular: 1
  },

  setup: (w) => {
    const path = require('path');

    const jestConfig = {
      resetMocks: true,
      resetModules: true,
      moduleFileExtensions: [
        'js',
        'jsx',
        'json',
        'ts',
        'tsx'
      ],
      globals: { __JEST_DEV__: true }
    };

    w.testFramework.configure(jestConfig);
  }
});
